import Head from "../components/Head";
import "../assets/tailwind.css";
import { CloudinaryContext } from "cloudinary-react";

export default function MyApp({ Component, pageProps }) {
  return (
    <>
      <Head />
      <CloudinaryContext cloudName="vercel">
        <Component {...pageProps} />
      </CloudinaryContext>
    </>
  );
}
